import cardsData from '../../../components/cards/cards';
import tableForm from './components/tableFrom';
import tableList from './components/tableList';
export default {
  name: 'orderlistDetails',
  components: {
    tableForm: tableForm,
    tableList: tableList,
    cardsData: cardsData
  },
  data: function data() {
    return {
      currentTab: '',
      cardLists: [],
      selection: [],
      orderData: {
        status: '',
        data: '',
        real_name: '',
        field_key: 'all',
        pay_type: ''
      },
      // display: 'none',
      autoDisabled: true,
      isAll: -1
    };
  },
  methods: {
    changeGetTabs: function changeGetTabs() {
      this.$parent.getTabs();
    },
    // tab xuanxiang dezhi
    getChangeTabs: function getChangeTabs(tab) {
      this.$refs.table.getList();
    },
    // 列表数据
    getData: function getData(res) {
      if (this.$refs.table) {
        this.$refs.table.checkBox = false;
        this.$refs.table.getList(res);
      }
    },
    // 模块数据
    getCards: function getCards(list) {
      this.cardLists = list;
    },
    handleResize: function handleResize() {
      this.$refs.ellipsis.forEach(function (item) {
        return item.init();
      });
    },
    orderSelect: function orderSelect(selection) {
      this.selection = selection;
    },
    onOrderData: function onOrderData(e) {
      this.orderData = e;
    },
    orderDatas: function orderDatas(e) {
      this.orderData = e;
    },
    onAutoDisabled: function onAutoDisabled(e) {
      this.autoDisabled = e ? true : false;
    },
    onAll: function onAll(e) {
      this.isAll = e;
    }
  },
  mounted: function mounted() {}
};
